#include <iostream>
#include <cctype>
using namespace std;

int main() {
    char ch;
    while (cin >> ch) {
        if (isalpha(ch))
        cout << ch << " is a letter!" << endl;
        else if (isdigit(ch))
        cout << ch << " is a digit!"
    }
    return 0;
}

#include <iostream>
#include <cctype>
using namespace std;

int main() {
    char ch;
    while (cin >> ch) {
        if (isalpha(ch))
        cout << ch << " is a letter!" << endl;
        else if (isdigit(ch))
        cout << ch << " is a digit!" << endl;
        else if (ispunct(ch))
        cout << ch << " is a punctuation character!" << endl;
    }
    return 0;
}

